import React from "react";
import { isMobile } from 'react-device-detect';
import Estilo from "../Hojas de Estilos/Menu.css";
function Menu({ activo }){
        const definirMenu = ()=>{
            let clase;
            if(isMobile){
                clase=activo ? "menu activo" : "menu";
            }else{
                clase="menu laptop";
            }
            return clase;
        }
    return(
        <div className={definirMenu()}>
                <a className="item-menu">Inicio</a>
                <a className="item-menu">Sobre Nosotros</a>
                <a className="item-menu">Experiencias</a>
                <a className="item-menu">Contactanos</a>
        </div>
    );
}
export default Menu;
